import React from 'react';
import { thisExpression } from '@babel/types';

class Contador extends React.Component{
    constructor(){
        super();
        this.state = {
            contador : 0
        }
    }
    render() {
        return(
            <div>
                <h1>
                    {this.state.contador}
                </h1>
                <div>
                    <button>-</button>
                    <button>+</button>
                </div>
            </div>
        )
    }
}

export default Contador;
